INSERT INTO `terms` VALUES (1,'Mkopo utaanza kuhesabiwa siku kuanzia tarehe ya kusaini mkopo.','2023-11-05 19:48:13','2023-11-05 19:48:13'),(2,'Kwa kukubali masharti mkopaji atawajibika kwa makosa yoyote ya mkopo kama\r\nkuchelewesha mkopo kutokana na muda wa kujitathimini utakapoisha ambayo ni wiki moja\r\ntu.','2023-11-05 19:48:13','2023-11-05 19:48:13'),(3,'Kwa wanafunzi wanufaika yaani wenye boom muda wa kurejesha ni pale utakapo pokea\r\nboom (stahiki zako) kwa hivo stahiki ikitoka chini ya siku 30 rudisha mkopo lakini pia stahiki\r\nikizidi siku 30 ambazo kampuni inatoa siku 21 tu za ziada kusubiri boom ambazo hutatozwa\r\nriba za ziada pia rejesha mkopo ipale utapopokea stahiki zako (boom) ','2023-11-05 19:48:47','2023-11-05 19:48:47'),(4,'Taasisi ina haki mbali na dhamana kuchukua hatua za kushtaki kwenye vyombo vya\r\nusalama au kupeleka kesi mahakamani na endapo mkopaji atakubali kupanda mahakamni\r\nna kampuni kushinda mkopaji atatakiwa kulipa mara mbili ya pesa aliyoazima kwa kampuni\r\nna fidia ya usumbufu kwa kupitia mwanasheria.','2023-11-05 19:48:47','2023-11-05 19:48:47');
